/*
Q3: How was the percentage of growth of the amount of visitors week over week for the
last four weeks of the data? Use SQL too.
*/


CREATE TABLE "restaurants_visitors" ("id" VARCHAR(20),"visit_date" DATE,"visit_datetime" VARCHAR(20),"reserve_datetime" VARCHAR(20),"reserve_visitors" SMALLINT);
SET datestyle = 'ISO, DMY';

-- Query Solution

WITH WeeklyVisitors AS (
  SELECT
    DATE_TRUNC('week', visit_date) AS week_start,
    SUM(reserve_visitors) AS total_visitors_per_week
  FROM restaurants_visitors r
  GROUP BY 1
), WeekOverWeekGrowth AS (
  SELECT
    w1.week_start,
    w1.total_visitors_per_week AS current_week_visitors,
    w2.total_visitors_per_week AS previous_week_visitors,
    (CAST((w1.total_visitors_per_week - w2.total_visitors_per_week) 
      AS DECIMAL(10,2)) / CAST(w2.total_visitors_per_week AS DECIMAL(10,2))
    ) * 100 AS growth_percentage
  FROM
    WeeklyVisitors w1
    JOIN WeeklyVisitors w2 ON w1.week_start = w2.week_start + INTERVAL '1 week'
)
SELECT week_start, previous_week_visitors, current_week_visitors, 
  CAST(growth_percentage AS DECIMAL(10, 2))
FROM WeekOverWeekGrowth
WHERE week_start >= (
  SELECT MAX(week_start) FROM WeeklyVisitors
) - INTERVAL '3 weeks'
ORDER BY 1 ASC;